import React from 'react';
import CardFilter from '../cardcomponent/CardFilter';


function RecentSalesTable({items}) {
    {console.log(items)}
    const handelStatus = status =>{
        switch(status){
            case 'Approved':
                return "success";
                break;
            case 'Panding':
                    return "warning";
                    break;
            case 'Rejected':
                    return "danger";
                    break;
            default:
                    return "warning";
                    break;
        }
    };
  return (
    <div className='card top-selling overflow-auto'>
        <CardFilter filterChange={handelStatus} />
        <div className='card-body pb-0'>
            
        </div>
    <table className='table table-borderless datatable'>
        <thead className='table-light'>
            <tr>
                <th scope='col'>#</th>
                <th scope='col'>Customer</th>
                <th scope='col'>Product</th>
                <th scope='col'>Price</th>
                <th scope='col'>Status</th>
            </tr>
        </thead>
        <tbody>
            {items && items.length >0 && 
            items.map(item=>(
                <tr key={item._id}>
                    <th scope='row'>
                        <a href='#'>{item.number}</a>
                    </th>
                    <td>{item.customer}</td>
                    <td>
                        <a href='#' className='text-primary'>{item.product}</a>
                    </td>
                    <td>${item.price.toFixed(2)}</td>
                    <td>
                        <span className={`badge bg-${handelStatus(item.status)}`}>{item.status}</span>
                    </td>
                </tr>
            ))
            }
        </tbody>
    </table>
    </div>
  )
}

export default RecentSalesTable
